import Vuex from 'vuex'

const pageOne = {
    state: () => ({
        user: 'Aqui a page1'
    })
}

const pageTwo = {
    state: () => ({
        user: 'Aqui a page2'
    })
}

export default new Vuex.Store({
    modules: {
        pageOne,
        pageTwo
    }
})

console.log('store.state.a.count');
